import React, { useState } from 'react';
import axios from 'axios';

function Api() {
    const url = "https://jsonplaceholder.typicode.com/photos/"
    const [apidata,setApidata]=useState([])
    const [no,setNo]= useState("");
    const URL = url+no;
    const fetchApi=()=>{
        axios.get("URL")
        .then((response)=>{
            console.log(response);

            setApidata(response.data)
        })
    }
  return (
    <>
       <input type="number"placeholder="Enter any number "  value={no} onChange={(e) => setNo(e.target.value)}/><br/><br/>
       <button className='button' onC={fetchApi}>Click me</button>

       <div>
           {
           apidata.map((value)=>{
            //    console.log(value)
               return(
                   <>
                   <p>Id:  {value.id}</p><hr></hr>
                   <p>AlbumId:  {value.albumId}</p><hr></hr>
                   <p>Title:  {value.title}</p><hr></hr>
                   <p>Url:  {value.url}</p><hr></hr>
                   <p>Thumbnailurl  :{value.thumbnailUrl}</p><hr></hr>
                   </>

               );
           })
           }
       </div>
    </>
  );

}

export default Api;
